import React, { useEffect, useState } from "react";
import Sidebar from "../components/Sidebar";
import Topbar from "../components/Topbar";
import Table from "../components/Table";

const Dashboard = () => {
  const [contracts, setContracts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(false);
  const [search, setSearch] = useState("");
  const [statusFilter, setStatusFilter] = useState("All");
  const [riskFilter, setRiskFilter] = useState("All");

  useEffect(() => {
    fetch("/contracts.json")
      .then((res) => res.json())
      .then((data) => {
        setContracts(data);
        setLoading(false);
      })
      .catch(() => {
        setError(true);
        setLoading(false);
      });
  }, []);

  // Filtered contracts
  const filteredContracts = contracts.filter((c) => {
    const matchesSearch =
      c.name.toLowerCase().includes(search.toLowerCase()) ||
      c.parties.toLowerCase().includes(search.toLowerCase());
    const matchesStatus = statusFilter === "All" || c.status === statusFilter;
    const matchesRisk = riskFilter === "All" || c.risk === riskFilter;
    return matchesSearch && matchesStatus && matchesRisk;
  });

  // Stats
  const totalContracts = contracts.length;
  const activeContracts = contracts.filter((c) => c.status === "Active").length;
  const highRiskContracts = contracts.filter((c) => c.risk === "High").length;

  return (
    <div className="flex h-screen bg-gray-100">
      <Sidebar />
      <div className="flex-1 flex flex-col">
        <Topbar />
        <div className="p-6">
          <h1 className="text-3xl font-bold mb-6 text-gray-800">Contracts Dashboard</h1>

          {/* Stats cards */}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-6">
            <div className="bg-white p-5 rounded-lg shadow hover:shadow-lg transition">
              <p className="text-gray-500">Total Contracts</p>
              <p className="text-2xl font-bold text-blue-600">{totalContracts}</p>
            </div>
            <div className="bg-white p-5 rounded-lg shadow hover:shadow-lg transition">
              <p className="text-gray-500">Active Contracts</p>
              <p className="text-2xl font-bold text-green-600">{activeContracts}</p>
            </div>
            <div className="bg-white p-5 rounded-lg shadow hover:shadow-lg transition">
              <p className="text-gray-500">High-Risk Contracts</p>
              <p className="text-2xl font-bold text-red-600">{highRiskContracts}</p>
            </div>
          </div>

          {/* Search & Filters */}
          <div className="flex flex-col md:flex-row gap-4 mb-6 items-start md:items-center">
            <input
              type="text"
              placeholder="Search by name or parties..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
              className="p-2 border rounded shadow focus:outline-none focus:ring-2 focus:ring-blue-500 w-full md:w-1/3"
            />
            <select
              value={statusFilter}
              onChange={(e) => setStatusFilter(e.target.value)}
              className="p-2 border rounded shadow focus:outline-none focus:ring-2 focus:ring-blue-500"
            >
              <option>All</option>
              <option>Active</option>
              <option>Expired</option>
              <option>Renewal Due</option>
            </select>
            <select
              value={riskFilter}
              onChange={(e) => setRiskFilter(e.target.value)}
              className="p-2 border rounded shadow focus:outline-none focus:ring-2 focus:ring-blue-500"
            >
              <option>All</option>
              <option>Low</option>
              <option>Medium</option>
              <option>High</option>
            </select>
          </div>

          {/* Table */}
          {loading && <p className="text-gray-500">Loading contracts...</p>}
          {error && <p className="text-red-500">Error loading contracts.</p>}
          {!loading && filteredContracts.length === 0 && (
            <p className="text-gray-500">No contracts found.</p>
          )}
          {!loading && filteredContracts.length > 0 && (
            <Table contracts={filteredContracts} />
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
